import React from 'react';

export default function Component() {
  return (
    <header className="w-full py-8 bg-gray-100 dark:bg-gray-800">
      <div className="container px-4 md:px-6">
        <h1 className="text-2xl font-bold tracking-tight text-gray-900 dark:text-gray-50">Streamlined Productivity</h1>
      </div>
    </header>
  )
}
